insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (1,'Tu es dans une station au bout de tout.\\1n \\1nOn envoie les nouveaux dans une station tranquille, et sans histoire pour commencer.\\1n \\1nBah oui, faut bien le temps que tu t adaptes à la nouvelle situation, et que tes neurones se remettent en route.\\1n \\1nAlors on va commencer soft. Tu vas aller casser quelques cailloux à l ancienne, tu verras rien d extraordinaire, mais rien de tel pour se dérouiller.\\1n \\1nBon maintenant il y a du boulot, et faut le faire, alors arrête de traîner dans mes pattes, c est pas comme si cela me plaisait d être ici non plus, à torcher des culs.\\1n \\1nOn me file toujours des sorties de frigo, si je pouvais avoir un vrai pilote pour une fois pour faire le ménage.',1,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (2,'L\'empire est là, et il a toujours été l.\\2nLes têtes changent, mais l\'Empire reste.\\2nOn y peut rien, et il faut faire le travail!',1,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (3,'Bah oui, tu parles, on est au bout de l univers, alors forcement tous les pirates du coin, ils en profitent.\\2nOn est juste une station miniere alors ca va, ils viennent nous faire chier qu une fois tous les X cycles, vu qu on n a que du minerai.\\2nIls viennent faire leur shopping en somme.\\2nBon moi cela fout bien les boules, j ai des quotas a remplir quand meme si un jour, je veux me sortir d ici, faudrait reussir a les arreter.\\2nPirates de mes deux!\\2nSi j avais un pilote qui valait quelque chose, je pourrai envoyer une escadrille nettoyer ce nid de felons!',1,100,0,1);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (4,'Oui, un vaisseau t attend dans le hangar. Il est equipe specialement pour cela. Alors ne t attend pas a faire des merveilles pour l instant, ni a jouer l as des as.\\2nSi tu t en sors bien, on verra pour mieux t equiper, et nous aider a la protection de la base.\\2nVa falloir que tu gagnes ta croute, alors va falloir t y mettre.',1,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (5,'Bonjour le nouveau,\\1n \\1nPas trop froid? Tu sors du frigo, alors ne t inquiete pas, tu vas avoir des nausees, et une sensation de froid qui va durer un certain temps.\\1n \\1nJ avais demande des recrues fraiches, mais je ne pensais pas que cela aurait ete pris au pied de la lettre. Je ferai attention la prochaine fois.\\1n \\1nJe vais t expliquer rapidement la situation. Comme tu vois, tu as ete decongele dans l espace. Ce n est pas ce que tu crois, tu n attends pas en orbite d une fabuleuse planete.\\1n \\1nOn a fait, comme on dirait, une petite pause pique nique, pour se ravitailler, et moi je dois fournir des metaux, alors tu es ici, pour aller en recolter.',1,100,1,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (6,'Maintenant que vous connaissez mieux ce qui se passe dans votre nouveau monde, il serait bon que vous appreniez à utiliser votre rafiot.\\2n\\2nAvant de vous donner des missions importantes, j\'aimerai que vous ayez un minimum de formation.\\2n\\2nPour cela, rendez vous dans la zone 2, où machin vous y attend. Il vous expliquera comment vous servir de cette guimbarde, en vous entraînant sur des drones.\\2n\\2nHa en passant, il m\'avez demandé un certain nombre de matériels pour sa station, vous pourriez lui apporter en passant?',3,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (7,'Y a quelque chose que tu n\'as pas compris?\\2nTu vas dans cette foutue station, et tu parles à machin\\2nFaut te décongeler complétement mon pauvre!!!',3,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (8,'Merci pour la livraison, vous avez ete efficace!',3,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (9,'Il est temps d aller vous entrainer\\2nIl y a quelques drones qui trainent dans les parages, allez en detruire 5 pour vous amuser, et revenez me voir une fois termine.',3,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (10,'Ce n etait pas dur.',3,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (11,'Vous etes arrives en groupe ces derniers temps.\\1n\\1nJ aimerai que vous montriez aux autres comment cela se passe ici, et demontrez votre leadership.\\1n\\1nAllez pourchasser quelques uns de vos camarades la dehors. Je suis sur que vous y prendrez plaisir.\\1n\\1nNe vous inquietez pas, cela n aura aucun impact sur eux. Je leur fournirai une vieille brouette, j en ai des tas a ecouler.\\1n',3,100,0,10);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (12,'Alors vous vous etes faits plaisirs en chassant vos petits camarades?\\1n\\1nPas assez apparemment, il vous en manque au compteur.\\1n\\1nAu lieu de me distraire, retournez vous amuser.',3,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (13,'Alors comment c etait de chasser des rookies?\\1n\\1nNe faites pas le fier a bras. Ce n etait que des rookies, et vos competences de vol sont encore loin d un vrai pilote.\\1n\\1nParlez en aux Celestes quand vous serez abattus.\\1n\\1nMais cela suffira pour une premiere fois.\\1n\\1nJ ai mieux a faire que vous maternez, allez trouver quelqu un d autre pour vous chanter une berceuse.',3,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (14,'Miner, Miner, Miner telle est la devise du centre.\\1n\\1nJ ai besoin de 500 minerai de fer rapidement. Aller me collecter ces minerais.',3,100,0,0);
insert  into `star025_dialogue`(`star025_id`,`star025_text`,`star025_idtype_star024`,`star025_proba`,`star025_readonce`,`star025_dialogue_star025`) values (15,'Merci',3,100,0,0);
